import styled from "styled-components";

export const Container = styled.div`
  display: flex;
  height: 20%;
  background-color: #f5f5f5;

  ul {
    display: flex;
  }

  ul li {
    list-style: none;
    margin: 0 10px 0 10px;
  }
`;
